package net.ericlefevre;

import java.util.Arrays;
import java.util.LinkedList;
import java.util.List;
import java.util.concurrent.TimeUnit;
import java.util.stream.Collectors;

public class Day5Polymers {
    static String p = "";
    //static String p = "abBA";

    public static void main(String[] args) {
        long start = System.nanoTime();
        String polymer = react(p);
        System.out.println(polymer);
        System.out.println(polymer.length());
        System.out.println("took " + TimeUnit.NANOSECONDS.toSeconds(System.nanoTime() - start) + " seconds");

        int lengthOfShortest = Integer.MAX_VALUE;
        for (char i = 'a'; i <= 'z'; i++) {
            String candidate = removeUnit(i, p);
            String collapsed = react(candidate);

            System.out.println(collapsed);
            System.out.println(collapsed.length());
            if (lengthOfShortest > collapsed.length()) {
                lengthOfShortest = collapsed.length();
            }
        }

        System.out.println("lengthOfShortest: " + lengthOfShortest);
        long end = System.nanoTime();
        System.out.println("took " + TimeUnit.NANOSECONDS.toSeconds(System.nanoTime() - start) + " seconds");
    }

    private static String removeUnit(char unit, String p) {
        StringBuilder newPolymer = new StringBuilder();

        for (char c : p.toCharArray()) {
            if (Character.toLowerCase(c) == unit) {
                continue;
            }
            newPolymer.append(c);
        }
        return newPolymer.toString();
    }

    private static String react(String polymer) {
        while (true) {
            if (polymer.length() == 0) {
                return "";
            }

            for (int i = 0; i < polymer.length(); i++) {
                if (Character.toLowerCase(polymer.charAt(i)) == Character.toLowerCase(polymer.charAt(i + 1)) && polymer.charAt(i) != polymer.charAt(i + 1)) {
                    String left = i > 0 ? polymer.substring(0, i) : "";
                    String right = i + 1 < polymer.length() ? polymer.substring(i + 2) : "";
                    polymer = left + right;
                    break;
                }

                if (i + 2 >= polymer.length()) {
                    return polymer;
                }
            }
        }
    }

}
